import { filterGenre } from "../../redux/reducer";

const Genres = ({ allGenres }) => {
   return (
    <>
      {allGenres?.map((option, key) => (
        <option key={key} value={option.name}>
          {option.name}
        </option>
      ))}
    </>
  );
};

